    const {candidates} = props
  return (
    <>
    {candidates.length === 0?
    (<h1>zero items</h1>):
    <div className='posts'>
    <Link to='/post'>

      <div className='description'>
          {candidates.map((candidate) =>(
              <div key={candidate.id}>
               <img src={props.image} alt='' />
         <h4 >{candidate.name}</h4>


        <Link to='/profile'>
          <button>View Profile</button>
        </Link>
                  </div>
          ))}

      </div>
    </Link>
  </div>
    }

    </>
  )

};

